description:
Categories Feature

Cast Eva Lovia, Abigail Mac, Abella Danger, Bonnie Rotten, Peta Jensen, Alexis Adams, Veronica Rodriguez, Kleio

James is a retired hit man, enjoying his continuous bedroom romps with his horny wife, Abigail Mac. In the middle of the night, intruders kidnap his wife as they beat him to a pulp. Later he receives a phone call from Danny, his old employer. Danny tells him he cant retire, and he has an assignment to complete or else his wife dies. He accepts, but upon arrival to the location witnesses big-breasted vixen, Alexis Adams screwing a random guy. Not easily distracted he continues his job, but discovers a target on his head worth a million dollars! Danny makes calls to several hit men, particularly the sexy Eva Lovia, whose incredible ass could kill with one look. Once shes finished banging her boy toy, she promises to kill James immediately. Too bad she doesnt know James has nothing to lose, and hell kill everyone to get the love of his life back, even if its for one final lay!
